function canvasToBlob(e,t,oVN){var ts=['webp','png','jpeg'],ti=ts.indexOf(t),u;if(ti>=0){t='image/'+t;}else{t='image/webp';}e.toBlob(b=>{u=URL.createObjectURL(b);if(typeof oVN!=='string'){oVN='BlobURL';}eval(oVN+' = "'+u+'";');},t,1);}function canvasToDataURL(e,t){var ts=['webp','png','jpeg'],ti=ts.indexOf(t);if(ti>=0){t='image/'+t;}else{t='image/webp';}return e.toDataURL(t,1);}function download(u,fN){if(u==undefined||u===""){return false;}if(fN==undefined){fN="";}var a=document.createElement('a');a.href=u;a.download=fN;a.click();return a;}
